### Terraform Version
* Terraform: ...
* Terraform Grafana Provider: 2.3.3
* Grafana: v10.0.2

### Affected Resource(s)
Please list the resources as a list, for example:
* grafana_dashboard

### Issue
Currently the parameter `folder` of the dashboard resource has the `ForceNew: true` set:
https://github.com/grafana/terraform-provider-grafana/blob/2ab68d404705628b7861ea95e4a08771e5c982ae/internal/resources/grafana/resource_dashboard.go#L65-L68

For the [crossplane provider-grafana](https://github.com/grafana/crossplane-provider-grafana) this can be annoying as it makes the field `folder` practically immutable. See this [upjet issue](https://github.com/crossplane/upjet/issues/78) discussing how to handle fields with  `ForceNew: true`.

Nonetheless in this case I actually have difficulty to understand why changing `folder` needs `ForceNew: true` set.

relevant history check of dashboard resource:
- implementation of the update functionality: https://github.com/grafana/terraform-provider-grafana/pull/52
- first try of that enhancement with discussion about not being able to move folders as expected: https://github.com/grafana/terraform-provider-grafana/pull/38#issuecomment-442347703


However when testing - with curl or the [grafana-api-golang-client](https://github.com/grafana/grafana-api-golang-client) - to move a dashboard between 2 folders, I actually did not ran into any problems. 

Here my go code used for testing:
```go
package main

import (
	log "log"

	gapi "github.com/grafana/grafana-api-golang-client"
)

func main() {

	// Create a new client
	c, err := gapi.New("<INSERT_GRAFANA_URL>", gapi.Config{
		APIKey: "<INSERT_APIKEY_OR_SERVICEACCOUNTTOKEN>",
	})
	if err != nil {
		log.Fatal(err)
	}

	// create folders
	folder1 := "golang-folder1"
	respFolder1, err := c.NewFolder(folder1, folder1)
	if err != nil {
		log.Fatal(err)
	}
	log.Printf("create folder action response: %v", respFolder1)
	folder2 := "golang-folder2"
	respFolder2, err := c.NewFolder(folder2, folder2)
	if err != nil {
		log.Fatal(err)
	}
	log.Printf("create folder action response: %v", respFolder2)

	// create dashboard
	dash := "golang-api-test"
	respDash1, err := c.NewDashboard(gapi.Dashboard{
		Overwrite: true, // needed to update
		Model: map[string]interface{}{
			"title":   dash,
			"uid":     dash,
			"version": "1", // seems to be ignored
		},
		FolderUID: folder1,
	})
	if err != nil {
		log.Fatal(err)
	}
	log.Printf("create dashboard action response: %v", respDash1)

	// check dashboard folder location
	resp1, err := c.DashboardByUID(dash)
	if err != nil {
		log.Fatal(err)
	}
	log.Printf("check dashboard action response: %v", resp1)

	// "update" dashboard
	respDash2, err := c.NewDashboard(gapi.Dashboard{
		Overwrite: true, // needed to update
		Model: map[string]interface{}{
			"title":   dash,
			"uid":     dash,
			"version": "1", // seems to be ignored
		},
		FolderUID: folder2,
	})
	if err != nil {
		log.Fatal(err)
	}
	log.Printf("update dashboard action response: %v", respDash2) // accepts changes, version will go up

	// check dashboard folder location
	resp2, err := c.DashboardByUID(dash)
	if err != nil {
		log.Fatal(err)
	}
	log.Printf("check dashboard action response: %v", resp2)

	// delete folders + dashboard
	log.Print("delete dashboard ...")
	err = c.DeleteDashboardByUID(dash)
	if err != nil {
		log.Fatal(err)
	}
	log.Print("delete folder1 ...")
	err = c.DeleteFolder(folder1) // wants uid not id ...
	if err != nil {
		log.Fatal(err)
	}
	log.Print("delete folder2 ...")
	err = c.DeleteFolder(folder2) // wants uid not id ...
	if err != nil {
		log.Fatal(err)
	}
}
``` 
